import React, { Component } from "react";
// import What from './components/What/What';
import classes from "./ArticlesPanel.module.css";

class ArticlesPanel extends Component {
  newArticlePrw = {
    title: "title",
    content: "Content",
    preview: "url",
    id: 0
  };

  newArticle = {
    title: "title",
    content: "Content",
    preview: "url"
  };

  // let createFunc = (com) => {
  //   let newCom = event.target.value;

  //   newArticlePrw.{com} = newCom;

  // }

  setTitle = () => {
    let newCom = event.target.value;
    newArticlePrw.title = newCom;
    newArticle.title = newCom;
  };
  setContentPrw = () => {
    let newCom = event.target.value;
    newArticlePrw.content = newCom;
  };
  setContent = () => {
    let newCom = event.target.value;
    newArticle.content = newCom;
  };
  setUrl = () => {
    let newCom = event.target.value;
    newArticlePrw.url = newCom;
    newArticle.url = newCom;
  };

  render() {
    return (
      <div className={classes.ArticlesPanel}>
        <h1>Add article</h1>
        <input
          onChange={this.setTitle}
          className={classes.Inputs}
          type="text"
          placeholder="Article`s title"
        />
        <input
          onChange={this.setUrl}
          className={classes.Inputs}
          type="text"
          placeholder="Picture`s url"
        />
        <input
          onChange={this.setContentPrw}
          className={classes.Inputs}
          type="text"
          placeholder="Preview content"
        />
        <input
          onChange={this.setContent}
          className={classes.Inputs}
          type="text"
          placeholder="Full content"
        />
        <button>Add</button>
      </div>
    );
  }
}

export default ArticlesPanel;
